import React, { useEffect, useState } from 'react';
import { fetchGuestList } from '../api/guest';

const GuestList = () => {
  const [guests, setGuests] = useState([]);

  useEffect(() => {
    const getGuests = async () => {
      try {
        const data = await fetchGuestList();
        setGuests(data);
      } catch (error) {
        console.error('ゲスト一覧の取得に失敗しました', error);
      }
    };

    getGuests();
  }, []);

  return (
    <div>
      <h2>宿泊者一覧</h2>
      <ul>
        {guests.map((guest) => (
          <li key={guest.id}>
            {guest.name}（{guest.phone}）
          </li>
        ))}
      </ul>
    </div>
  );
};

export default GuestList;
